Each one of these posts caused 10 sq/ft of bee habitat to be planted! That’s how #beeskneesweek works and you can help the cause by having another 10 sq/ft of bee habitat planted in your behalf if you get your hands on some @barrhillgin, make a Bee’s Knees Cocktail, and post it along with #beeskneesweek. That’s it! It’s that simple, it helps save the bees, and it’s awesome…plus you may even be featured on LTD as we continue sharing some our favorites!  Check out the link in our bio for more info. 🐝🍹

Big thanks to all those tagged on these posts, @barrhilgin, and the thousands of others working together on this to help save the bees! 🙌🙏

